var title_f16_32_16905="EP study tracings mapping slow AV nodal pathway";
var content_f16_32_16905=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F77513%7ECARD%2F58652&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F77513%7ECARD%2F58652&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 602px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG recordings during electrophysiologic study showing identification of slow pathway for ablation of AV nodal reentrant tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 582px; height: 413px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are three surface ECG leads (I, aVF, V1), and intracardiac recordings from the high right atrium (HRA3-4), proximal (HBE3-4,) and distal His bundle region (HBE1-2), proximal to distal coronary sinus (CS9-10, CS7-8, CS5-6, CS3-4, and CS1-2), and the right ventricular apex (RVA3-4). The patient had a history of medically refractory supraventricular arrhythmia and the diagnostic study revealed easily inducible, typical atrioventricular (AV) nodal reentrant tachycardia. The HBE catheter was maneuvered from the His position to the slow pathway region, which is typically inferior and posterior to the His bundle and just anterior to the coronary sinus ostium. This is an ideal site for slow pathway ablation and has a small atrial electrogram (A) and large ventricular electrogram (V), with no evidence of His bundle activity. The tip of the HBE catheter (HBE1-2) records such a signal, and is used for ablation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 552px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG recordings during electrophysiologic study showing identification of site for ablation of AV nodal reentrant tachycardia (AVNRT)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 532px; height: 365px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are three surface ECG leads (I, aVF, V1) and intracardiac recordings from the high right atrium (HRA3-4); proximal (HBE3-4) and distal His bundle region (HBE1-2), which is obtained from the mapping catheter; proximal to distal coronary sinus (CS9-10, CS7-8, CS5-6, CS3-4, and CS1-2); and the right ventricular apex (RVA3-4). During sinus rhythm, the usual atrial (A) to ventricular (V) activiation sequence is seen. Application of radiofrequency (RF) energy to the tip of the HBE catheter (HBE1-2) promptly causes an accelerated junctional rhythm (*), further evidence of a good ablation site. Note that during the accelerated junctional rhythm, there is rapid 1:1 retrograde conduction to the atria (A), evidence that the fast AV nodal pathway is intact. Following this energy application, there was no evidence of slow pathway conduction and no inducible AVNRT.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
