"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Study",
"       </td>",
"       <td class=\"subtitle1\">",
"        N",
"       </td>",
"       <td class=\"subtitle1\">",
"        Initiation of anticoagulation and outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Punthakee, et al (2003)",
"       </td>",
"       <td>",
"        7",
"       </td>",
"       <td>",
"        Warfarin started a mean of 14 days (9-15 days in 4 pts); no ICH enlargement or thrombotic events.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Kawamata, et al (1995)",
"       </td>",
"       <td>",
"        13",
"       </td>",
"       <td>",
"        Six underwent surgery. Of 20 patients with intracranial hemorrhages and prosthetic valves, one thromboembolism in a setting of early postoperative heparin.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Butler and Tait (1998)",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        Heparin on day 3 (range 1-6) and warfarin on day 7 (range 3-19) in 10 patients with ICH (n=4) or subdural hematomas (n=6); no ICH enlargement or thrombotic events.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bertram, et al (2000)",
"       </td>",
"       <td>",
"        13",
"       </td>",
"       <td>",
"        Full-dose intravenous heparin on days 1 and 2 to seven patients, with hematoma enlargement in two. Of six patients given low-dose heparin, three had ischemic strokes on days 2, 4, and 5 (all had previously been treated with prothrombin complex concentrates).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Phan, et al (2000)",
"       </td>",
"       <td>",
"        87",
"       </td>",
"       <td>",
"        Anticoagulation withheld for mean of 10 days, acute treatment to reverse anticoagulation not reported, and one ischemic stroke. The 30-day thromboembolism rate estimated as 3 percent for those with prosthetic cardiac valves.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Babikian, et al (1998)",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        Of six patients with prosthetic cardiac valves (3 with ICHs and 3 with subdurals), warfarin interrupted for a mean of 19 days without thromboembolism.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Leker and Abramsky (1998)",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        Four patients given IV heparin 24-36 hours as soon as INR &lt;1.5 following vitamin K and plasma infusion. No worsening.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gomez, et al (1988)",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        Heparin on day 10 without hemorrhagic worsening in one patient.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
